import React from "react";
import logo from '../images/sapphirelogo.svg';
import { animateScroll as scroll } from "react-scroll";
import Services from './Tabs/Services';
import About from './Tabs/About';
import Philantrophy from './Tabs/Philantrophy';
import '../css/foundation/assets/css/foundation.css';
import ResponsiveMenu from 'react-responsive-navbar';
import { FaBars, FaClose } from 'react-icons/fa';
import PhilantrophySection from "./Sections/Philantrophy";


const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  return (
    <ResponsiveMenu
      menuOpenButton={<FaBars size={30} />}
      menuCloseButton={<FaClose size={30} />}
      changeMenuOn="40em"
      largeMenuClassName='large-menu-classname'
      smallMenuClassName='small-menu-classname'
      menu={
        <div>
          <Services />
          <About />
          <Philantrophy />

          <img src={logo}
            className='nav-logo'
            alt='logo'
            onClick={scrollToTop} />
        </div>
      }
    />
    // <div>
    //   <Services />
    //   <About />
    //   <Philantrophy />

    //   <img
    //     src={logo}
    //     className="nav-logo"
    //     alt="Logo"
    //     onClick={scrollToTop}
    //   />
    // </div>
  );
}

export default Navbar;
